const Login = () => {
  return (
    <>
      <div className="login-container">
        <h1>Login</h1>
        <form action="" method="POST">
          <input type="text" name="email" placeholder="email"></input> <br />
          <input
            type="text"
            name="password"
            placeholder="password"
          ></input>{" "}
          <br />
          <button>Login</button>
        </form>
        <h3>Forgot password?</h3>
      </div>
    </>
  );
};

export default Login;
